5<\/td><td>4.53<\/td><td>5.59<\/td><td>6.16<\/td><td>3.72<\/td><\/tr><tr><td>Fremantle<\/td><td>8.47<\/td><td>7.56<\/td><td>6.02<\/td><td>4.34<\/td><td>3.06<\/td><td>2.54<\/td><td>2.74<\/td><td>3.64<\/td><td>4.99<\/td><td>6.52<\/td><td>7.73<\/td><td>8.49<\/td><td>5.49<\/td><\/tr><tr><td>Melbourne<\/td><td>6.35<\/td><td>5.84<\/td><td>4.59<\/td><td>3.29<\/td><td>2.29<\/td><td>1.85<\/td><td>2.04<\/td><td>2.78<\/td><td>3.71<\/td><td>4.84<\/td><td>5.71<\/td><td>6.22<\/td><td>4.12<\/td><\/tr><tr><td>Newcastle<\/td><td>6.24<\/td><td>5.5<\/td><td>4.76<\/td><td>3.8<\/td><td>2.93<\/td><td>2.65<\/td><td>2.87<\/td><td>3.79<\/td><td>4.83<\/td><td>5.76<\/td><td>6.11<\/td><td>6.53<\/td><td>4.64<\/td><\/tr><tr><td>Sydney<\/td><td>5.94<\/td><td>5.28<\/td><td>4.55<\/td><td>3.59<\/td><td>2.79<\/td><td>2.52<\/td><td>2.72<\/td><td>3.61<\/td><td>4.65<\/td><td>5.54<\/td><td>5.91<\/td><td>6.28<\/td><td>4.44<\/td><\/tr><tr><td>Perth<\/td><td>8.44<\/td><td>7.53<\/td><td>6.02<\/td><td>4.38<\/td><td>3.16<\/td><td>2.66<\/td><td>2.87<\/td><td>3.75<\/td><td>5.09<\/td><td>6.56<\/td><td>7.75<\/td><td>8.50<\/td><td>5.55<\/td><\/tr><\/table><\/div>",V0="<div><h1>Government Subsidization<\/h1><br><p>In Australia, there are in essence two types of financial incentives schemes designed to encourage the uptake of solar power and other types of renewable energy. On the federal level, rebates are offered in the form of Renewable Energy Certificates (RECs). This rebate for solar installations is available anywhere in Australia. RECs come in 2 forms: Small-scale Technology Certificates (STCs) for renewable energy generators up to 100 kilowatts (kW), and Large-scale Generation Certificates (LGCs) for systems whose capacity isgreater than 100kW.<\/p><br><p>In addition to RECs, most states also offer support for solar and other renewables via Feed-in Tariff schemes, under which system owners are paid for each unit of power that they export to the electricity grid. Eligibility for Solar Feed-in Tariffs depends firstly on whether a state or regional scheme is in place, but other factors include date of system installation and system size. Feed-in Tariffs rates offered can be nonexistent or pay as much as 68c per kilowatt-hour. Most states either currently have or previously had a Solar Feed-in Tariff in place.<\/p><br><table border='1'><tr><td>State<\/td><td>Current Scheme<\/td><td>Max Size<\/td><td>Rate Paid<\/td><td>Program Duration<\/td><\/tr><tr><td>TAS<\/td><td>1-for-1 Solar Buyback through Aurora Energy<\/td><td>10kW (single phase), 30kW (three phase)<\/td><td>1:1* (through Aurora Energy)<\/td><td>Not set end-date<\/td><\/tr><tr><td>QLD<\/td><td>Queensland Solar Bonus Scheme<\/td><td>5kW<\/td><td>(Formerly 44c+/kWh for those with application submitted before midnight 9 June 2012)<\/td><td>To be reviewed by 1 July 2013, to conclude on 1 July 2014<\/td><\/tr><tr><td>NSW<\/td><td>Voluntary Solar Buyback through some electricity retailers<\/td><td>Depends on retailer<\/td><td>0-8c/kWh, depending on retailer<\/td><td>No set end-date<\/td><\/tr><\/table><\/div>",g1="<div><h1>Installation Guidelines<\/h1><br><p>The power of a solar system tells you how much energy it CAN produce, and is measured by the unit of power, kilowatts (kW). This measure is telling you how big the system is, or in other words, what it's capacity to produce power is. The amount of energy a solar system will produce is measured in kilowatt hours (kWh) ?which remember, is just another way of talking about energy which is otherwise measured in joules. Site your solar panel array where there will be no regular shading. This is the first and most obvious step to making sure your system does not suffer the consequences of being partially shaded.<\/p><br><p>It is extremely important to consider all times of day for all seasons of the year when working out whether some nearby object might cast a shadow onto your roof. You can check this yourself or alternatively your Solar Choice broker will check to ensure there is no shading on your roof using a program called Nearmap. Solar system owners should also be vigilant in making sure that there are no nearby trees which might grow tall enough to eventually cause shading issues. Solar system lifespans are typically expected to be 25+ years, during which time trees have plenty of time to grow. Clouds are another source of potential shading.<\/p><br><p>Clouds passing through the sky during the day may also result in fluctuations in system output, but these are basically unavoidable. Amorphous silicon solar cells are said to be better at handling shading than crystalline silicon solar panels, but generally speaking the relatively low overall efficiency of amorphous panels means that crystalline modules are a better choice. There are some other technologies under development that may offer high efficiencies even in inclement weather, such as 'super black' solar cells, but most of these are still either expensive or not yet commercially available.<\/p><br><p>Roof space available for solar panels. One obvious factor to be taken into consideration when mounting panels on a roof is the amount of space available on it. A typical polycrystalline or monocrystalline panel measures about 1.6m x 1m, and depending on the capacity (size in watts) of your system, for an average 2 or 3-bedroom home, you should be able to fit enough panels to significantly offset your electricity costs on one, or in a stretch, two parts of your roof. Closeness of the panels to your home is not an absolute requirement: the roofs of sheds, garages, and balconies that stand slightly apart from your house may also provide options for placement.<\/p><\/div>",f1="<div><h1>Reasons of using Solar<\/h1><br><h3>Durability & Longevity<\/h3><p>On average, a solar panel can last up to 30 years or more.With just a few arrays set up, you can be powering your home withyour own renewable energy. Not only that, but solar panels are designed to withstand harsh climates. One common misconception is that you need the sun shining to convert toelectricity. Solarpanels can still convert from solar energy to electrical or thermal power even on a cloudy day (although not at the same capacity)<\/p><h3>Unlimited Power<\/h3><p>While everyone else is crying and whining about gas prices and high energy costs - you will have an unlimited supply of solar power. Unless the sun blows up and destroys our entire solar system - you won't really need to worry about never having power.<\/p><h3>Tax Incentives<\/h3><p>Once you invest into solar, you are eligible for Federal, State, Provincial And Utility Tax incentives and rebates. These aren't the'$30 off' from your coffee maker rebates - they add up big time! For example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>",CZ='<gwt:clipper style="',_V='<html><body onload="if(parent.__gwt_onHistoryLoad)parent.__gwt_onHistoryLoad(__gwt_historyToken.innerText)"><div id="__gwt_historyToken">',JZ="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",iU='=',BU='>',eZ='?',aS='@',CY='A PotentialElement cannot be resolved twice.',ET='A request timeout has expired after ',zW='A32F02F1911204BA41E8517251689C5F',fS='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTBfUk9TZrBRaIteybtnU2KziHEpRQvhPNTjo7DMczjrRD3yBPRJ_BSQQ',eS='ABQIAAAAG8LzhtshQCjpSshU_uJjmxTwM0brOpm-All5B
